import React from 'react'
import Line from "react-chartjs-2";

function Chart() {
    const data = {
        x : 125,
        y : 65
    }
    return (
        <div>
            <Line data={data}
                 width={250}
                 height={250}
                 options={{ maintainAspectRatio: false }}
            />
        </div>
    )
}

export default Chart
